import { Injectable } from '@angular/core';
import {Router} from "@angular/router";

@Injectable({
  providedIn: 'root'
})
export class SessionService {

  constructor(private router: Router) { }

  log_in(access_token: string, refresh_token: string){
     localStorage.setItem('access_token', access_token);
     localStorage.setItem('refresh_token', refresh_token);
  }

  async log_out(){
    localStorage.removeItem('access_token');
    localStorage.removeItem('refresh_token');
    await this.router.navigateByUrl('welcome');
  }

  isAuth(): boolean {
    return this.get_access_token() !== null && this.get_access_token() !== '';
  }

  get_access_token(): string {
    return localStorage.getItem('access_token');
  }

  get_refresh_token(): string {
    return localStorage.getItem('refresh_token');
  }
}

import { Injectable } from '@angular/core';
import SpotifyWebApi from 'spotify-web-api-js';
import {SessionService} from "./session.service";


@Injectable({
  providedIn: 'root'
})
export class SpotifyConnectorService {

  spotifyApi: SpotifyWebApi.SpotifyWebApiJs;
  constructor(private session: SessionService) {
    this.spotifyApi = new SpotifyWebApi();
  }
  async setTokenToSpotifyObject() {
    await this.spotifyApi.setAccessToken(this.session.get_access_token());
  }
  async getAccount(): Promise<SpotifyApi.CurrentUsersProfileResponse>{
    await this.setTokenToSpotifyObject()
    return await this.spotifyApi.getMe();
  }
  async getUserPlaylists(): Promise<SpotifyApi.ListOfUsersPlaylistsResponse> {
    await this.setTokenToSpotifyObject();
    return await this.spotifyApi.getUserPlaylists();
  }
  async is_token_valid(): Promise<boolean> {
    try {
      await this.getAccount();
      return true;
    } catch (e) {
      return false;
    }
  }
}

export const randomString = (length: number): string => {
    let res = '';
    for(res; res.length < length;){
        res += "0123456789ABCDEFGHIJKLMNOPQRSTUVWXTZabcdefghiklmnopqrstuvwxyz"[(Math.random() * 60) | 0]
    }
    return res;
}
export const set_header = (access_token: string) => {
    if (access_token) {
        return {
            setHeaders: {
                access_token: access_token
            }
        }
    } else return {}
}

import { Injectable } from '@angular/core';
import {HttpClient} from "@angular/common/http";
import {environment} from "../environments/environment";
import {Observable} from "rxjs";
import {ISpotifyToken} from "../../../../lib/interfaces/auth";

@Injectable({
    providedIn: 'root'
})
export class AuthService {

    api = `https://${environment.SF_BACKEND_ADDR_DEV}:${environment.SF_BACKEND_PORT}`;

    constructor(private http: HttpClient) {}

    getAuthorizeURL(state: string): Observable<string>{
        return this.http.get(`${this.api}/login`, {responseType: 'text', headers: {state: state}});
    }

    getCallback(qP: any): Observable<{access_token: string, refresh_token: string}>{
        return this.http.get<{access_token: string, refresh_token: string}>(`${this.api}/callback`, {headers: qP});
    }

    refreshToken(refresh_token: string): Observable<ISpotifyToken>{
        return this.api_get('/token', {refresh_token: refresh_token});
    }

    api_get(path: string, headers?: any): Observable<any> {
        return this.http.get(this.api + path, {headers: {... headers}})
    }

}

import { Injectable } from '@angular/core';
import {HttpEvent, HttpHandler, HttpInterceptor, HttpRequest} from "@angular/common/http";
import {BehaviorSubject, Observable, throwError} from "rxjs";
import {catchError, filter, switchMap, take} from "rxjs/operators";
import {SpotifyConnectorService} from "./spotify-connector.service";
import {set_header} from "../utils";
import {SessionService} from "./session.service";
import {AuthService} from "./auth.service";

@Injectable({
    providedIn: 'root'
})
export class ErrorInterceptorService implements HttpInterceptor{
    private is_refreshing = new BehaviorSubject<boolean>(false);
    constructor(private spotify: SpotifyConnectorService, private session: SessionService, private auth: AuthService) { }

    intercept(req: HttpRequest<any>, next: HttpHandler): Observable<HttpEvent<any>> {
        return next.handle(req.clone(set_header(this.spotify.spotifyApi.getAccessToken()))).pipe(
            catchError(err => {
                switch (err.status) {
                    case 400:
                        this.session.log_out().then(() => {
                            alert('Refresh token expired. Please log in again.')
                        });
                        break;
                    case 401:
                        return this.handle401Error(req, next);
                    default: return throwError(err);
                }
            }),
        );
    }
    private handle401Error(req: HttpRequest<any>, next: HttpHandler): Observable<HttpEvent<any>> {
        if (!this.is_refreshing.getValue()) {
            this .is_refreshing.next(true);
            this.auth.refreshToken(this.session.get_refresh_token()).subscribe((token) => {
                this.session.log_in(token.access_token, this.session.get_refresh_token());
                this.is_refreshing.next(false);
            });
        }
        return this.is_refreshing.pipe(
                filter(is_refreshing => is_refreshing === false), take(1),
                switchMap(() => this.spotify.spotifyApi.getAccessToken()
                ? next.handle(req.clone(set_header(this.spotify.spotifyApi.getAccessToken())))
                    : throwError(new Error('Not authorized'))
                )
            )

    }
}

import { Injectable } from '@angular/core';
import { HttpRequest, HttpHandler, HttpEvent, HttpInterceptor } from '@angular/common/http';
import { Observable } from 'rxjs';
import {set_header} from "../utils";
import {SpotifyConnectorService} from "./spotify-connector.service";

@Injectable()
export class AuthInterceptorService implements HttpInterceptor {
    constructor(private spotify: SpotifyConnectorService) { }

    intercept(request: HttpRequest<any>, next: HttpHandler): Observable<HttpEvent<any>> {
        const access_token = this.spotify.spotifyApi.getAccessToken();
        if (access_token) {
            request = request.clone(set_header(this.spotify.spotifyApi.getAccessToken()));
        }
        return next.handle(request);
    }
}

